import React from "react";

export const Home = () => {
    return(
        <>
       <div className="Horoimg">
        <img src="https://www.eraktkosh.in/BLDAHIMS/bloodbank/transactions/assets/webp/donationFact.webp" alt="Hero-image" />
       </div>
       <div>
        <div className="red"></div>
        <div className="blue"></div>
       </div>
        </>
    );
};
